/* 寄存器说明：
 bit[31:16]  保留
 bit[15]     为解决使能关闭仍上报中断问题，增加中断屏蔽机制，可以解决该问题。该信号为中断屏蔽机制的bypass信号：0表示中断屏蔽机制生效；1表示中断屏蔽机制不生效。该值默认为0，增加该信号是为了防止该修改引入其他问题而加的保险措施，DSP配置该信号为0即可。
 bit[14]     内插Disable控制信号，1表示不进行内插，即内插出来的值为0；0表示进行内插
 bit[13]     0为只搜主发射天线,1为只搜辅发射天线
 bit[12:11]  用于指示该单元功能
                bit[12:11]=00/01,搜索或测量
                bit[12:11]=10,IC邻小区搜索
                bit[12:11]=11,,均衡主小区搜索
 bit[10]     接收载波选择，0为主载波，1为辅载波;
 bit[9]      搜索测量连续/触发模式使能,1为连续模式,0为触发模式;
 bit[8]      采样纠偏挂接标志，1为做采样纠偏,0为不做;
 bit[7]      接收导频选择,0为主导频,1为辅导频,同时配置其他接口OVSF码;
 bit[6]      径选择方式控制，0为径选择方式1,1为径选择方式2;
 bit[5]      接收天线选择标志，0为接收天线1;1为接收天线2;
 bit[4]      iPS控制,0为不做iPS,1为做;
 bit[3]      本异频指示,0为本频,1为异频
 bit[2:0]    非相干累加alpha滤波指示
                 3'b0或3'b111或3'b001:上电空闲态;
                 3'b010:alpha滤波系数为0;
                 3'b011:alpha滤波系数为1/2;
                 3'b100:alpha滤波系数为1/4;
                 3'b101:alpha滤波系数为1/8;
                 3'b110:alpha滤波系数为1/16;
   UNION结构:  WBBP_MPSRCH_MODE_4_UNION */
#define WBBP_MPSRCH_MODE_4_ADDR                       (SOC_BBP_WCDMA_BASE_ADDR + 0x20C4)

