/* 寄存器说明：
   详      述：软件设定的等待超时中断上报时长。定时器时长 = Hsd_rpt_overtime_value *32*Tclk，其中Tclk为译码时钟（245.76MHz）周期。当有TB块译码成功后并搬移完成后，如果此时上报定时器没有启动时则BBP启动上报定时器，一旦定时器超时，则判断TB CNT是否为0，如果不为0则上报中断，并立即启动新的定时器；否则不启动新的定时器，且不上报中断。
            同一时间定时器只会启动一个。
            软件清空上报区时该定时器也被关闭。
            初始值为10ms，即10ms*245.76MHz/32。
            注意1：当定时器达到门限时，由此时的TB_CNT值是否为零直接决定是否发中断，不会考虑此时是否有一个新TB块正好完成上报。如果此时有一个新TB块正好完成上报，则其导致的中断应该在下一个定时周期结束时才会产生。
            注意2：硬件支持的定时器计时门限取值范围为1~（2^32-1），由软件根据需要选择使用。在选择门限时，软件需要充分考虑所能承受超时中断的能力，例如软件如果将门限值配成1，则一旦有一个新TB块完成上报后，1*32个BBP工作时钟（245.76MHz）后就会产生超时中断；如果软件无法及时响应中断后屏蔽中断并将数据完全移走，则BBP会以1*32个BBP工作时钟为周期连续发出超时中断，这可能会导致软件内存耗尽并最终导致单板复位，故软件需要根据自身处理中断以及搬移数据的能力来选择合适的超时门限。
   UNION结构 ：无 */
#define WBBP_HSD_RPT_OVERTIME_VALUE_ADDR              (SOC_BBP_WCDMA_BASE_ADDR + 0x9420)

