#define WBBP_MPSRCH_MODE_10_mpsrch_mode10_rx_ind_START           (5)
#define WBBP_MPSRCH_MODE_10_mpsrch_mode10_rx_ind_END             (5)
#define WBBP_MPSRCH_MODE_10_mpsrch_mode10_sel_START              (6)
