#define WBBP_MPSRCH_MODE_11_mpsrch_mode11_function_sel_END       (12)
#define WBBP_MPSRCH_MODE_11_mpsrch_mode11_tx_ind_START           (13)
#define WBBP_MPSRCH_MODE_11_mpsrch_mode11_tx_ind_END             (13)
