/*****************************************************************************
 结构名    : WBBP_STEP1_FAIL_THRESHOLD_UNION
 结构说明  : STEP1_FAIL_THRESHOLD 寄存器结构定义。地址偏移量:0x000，初值:0x00000003，宽度:32
 寄存器说明: 
*****************************************************************************/
typedef union
{
    unsigned long      step1_fail_threshold_reg;
    struct
    {
        unsigned long  step1_fail_threshold : 7;  /* bit[0-6] : 此寄存器决定了初始小区搜索的最长搜索时间。
                                                                最长搜索时间为：STEP1_FAIL_THRESHOLD*Step1搜索时间。Step1搜索时间由配置决定，默认为3帧。
                                                                在最长搜索时间内，一旦搜索到了小区信息，则用成功中断将小区信息上报DSP，并停止搜索；如果在最长搜索时间内，没有搜索到小区信息，则使用失败中断上报DSP，并停止搜索。
                                                                STEP1_FAIL_THRESHOLD配置值为大于等于3的整数。
                                                                初始小区搜索的时间：最短为9帧；最长为（STEP1_FAIL_THRESHOLD*Step1搜索时间）。 */
        unsigned long  reserved             : 25; /* bit[7-31]: 保留 */
    } reg;
} WBBP_STEP1_FAIL_THRESHOLD_UNION;
#define WBBP_STEP1_FAIL_THRESHOLD_step1_fail_threshold_START  (0)
#define WBBP_STEP1_FAIL_THRESHOLD_step1_fail_threshold_END    (6)


