/*****************************************************************************
 结构名    : WBBP_FG_NOISE_FACTOR_UNION
 结构说明  : FG_NOISE_FACTOR 寄存器结构定义。地址偏移量:0x57C，初值:0x00000007，宽度:32
 寄存器说明: 
*****************************************************************************/
typedef union
{
    unsigned long      fg_noise_factor_reg;
    struct
    {
        unsigned long  cpu_fg_noise_factor : 4;  /* bit[0-3]  : 噪声门限因子。
                                                                4'd0，噪声门限因子为1/8；
                                                                4'd1，噪声门限因子为1/4；
                                                                4'd2，噪声门限因子为3/8；
                                                                4'd3，噪声门限因子为1/2；
                                                                4'd4，噪声门限因子为5/8；
                                                                4'd5，噪声门限因子为3/4；
                                                                4'd6，噪声门限因子为7/8；
                                                                4'd7，噪声门限因子为1；
                                                                4'd8，噪声门限因子为9/8；
                                                                4'd9，噪声门限因子为5/4；
                                                                4'd10，噪声门限因子为11/8；
                                                                4'd11，噪声门限因子为3/2；
                                                                4'd12，噪声门限因子为13/8；
                                                                4'd13，噪声门限因子为7/4；
                                                                4'd14，噪声门限因子为15/8；
                                                                4'd15，噪声门限因子为2。
                                                                不同门限表示在锁定失锁判决时对噪声的加权因子，推荐配置7。 */
        unsigned long  reserved_0          : 12; /* bit[4-15] : 保留 */
        unsigned long  cpu_serv_rl_weight  : 2;  /* bit[16-17]: FSM权值计算时，对不同小区的加权。
                                                                2'b00，服务小区与非服务小区所占对应比例为1:1；
                                                                2'b01，服务小区与非服务小区所占对应比例为3:1；
                                                                2'b10，只解调服务小区；
                                                                2'b11，无效值，未使用。
                                                                该寄存器主要作用是在HSDPA业务中如果有增强服务小区需求时可以配置调整服务小区与非服务小区所占比例，默认值为0。 */
        unsigned long  reserved_1          : 14; /* bit[18-31]: 保留 */
    } reg;
} WBBP_FG_NOISE_FACTOR_UNION;
#define WBBP_FG_NOISE_FACTOR_cpu_fg_noise_factor_START  (0)
#define WBBP_FG_NOISE_FACTOR_cpu_fg_noise_factor_END    (3)
#define WBBP_FG_NOISE_FACTOR_cpu_serv_rl_weight_START   (16)
#define WBBP_FG_NOISE_FACTOR_cpu_serv_rl_weight_END     (17)


