/*****************************************************************************
 结构名    : WBBP_AFC_NOISE_FACTOR_UNION
 结构说明  : AFC_NOISE_FACTOR 寄存器结构定义。地址偏移量:0x590，初值:0x04070007，宽度:32
 寄存器说明: 
*****************************************************************************/
typedef union
{
    unsigned long      afc_noise_factor_reg;
    struct
    {
        unsigned long  cpu_afc_lock_noise_factor   : 4;  /* bit[0-3]  : AFC锁定时的噪声门限。
                                                                        4'd0，噪声门限为0；
                                                                        4'd1，噪声门限为2/4；
                                                                        4'd2，噪声门限为3/4；
                                                                        4'd3，噪声门限为4/4；
                                                                        4'd4，噪声门限为5/4；
                                                                        4'd5，噪声门限为6/4；
                                                                        4'd6，噪声门限为7/4；
                                                                        4'd7，噪声门限为8/4；
                                                                        4'd8，噪声门限为9/4；
                                                                        4'd9，噪声门限为10/4；
                                                                        4'd10，噪声门限为11/4；
                                                                        4'd11，噪声门限为12/4；
                                                                        4'd12，噪声门限为13/4；
                                                                        4'd13，噪声门限为14/4；
                                                                        4'd14，噪声门限为15/4；
                                                                        4'd15，噪声门限为16/4。
                                                                        复位后初始化为7，即信号能量为噪声能量的2倍时，该径参与AFC鉴频。 */
        unsigned long  reserved_0                  : 12; /* bit[4-15] : 保留 */
        unsigned long  cpu_afc_unlock_noise_factor : 4;  /* bit[16-19]: AFC失锁时的噪声门限。
                                                                        4'd0，噪声门限为0；
                                                                        4'd1，噪声门限为1/4；
                                                                        4'd2，噪声门限为3/8；
                                                                        4'd3，噪声门限为1/2；
                                                                        4'd4，噪声门限为5/8；
                                                                        4'd5，噪声门限为3/4；
                                                                        4'd6，噪声门限为7/8；
                                                                        4'd7，噪声门限为1；
                                                                        4'd8，噪声门限为9/8；
                                                                        4'd9，噪声门限为5/4；
                                                                        4'd10，噪声门限为11/8；
                                                                        4'd11，噪声门限为3/2；
                                                                        4'd12，噪声门限为13/8；
                                                                        4'd13，噪声门限为7/4；
                                                                        4'd14，噪声门限为15/8；
                                                                        4'd15，噪声门限为2。
                                                                        复位后初始化为7，即信号能量为噪声能量的1倍时，该径参与AFC鉴频。 */
        unsigned long  reserved_1                  : 4;  /* bit[20-23]: 保留 */
        unsigned long  cpu_afc_lock_cnt            : 3;  /* bit[24-26]: 一次锁定失锁判决过程中I和Q的比较次数。默认为4，如果需要修改则在开机初始化时配置。 */
        unsigned long  reserved_2                  : 5;  /* bit[27-31]: 保留 */
    } reg;
} WBBP_AFC_NOISE_FACTOR_UNION;
#define WBBP_AFC_NOISE_FACTOR_cpu_afc_lock_noise_factor_START    (0)
#define WBBP_AFC_NOISE_FACTOR_cpu_afc_lock_noise_factor_END      (3)
#define WBBP_AFC_NOISE_FACTOR_cpu_afc_unlock_noise_factor_START  (16)
#define WBBP_AFC_NOISE_FACTOR_cpu_afc_unlock_noise_factor_END    (19)
