/*****************************************************************************
 结构名    : WBBP_PC_NOISE_ALPHA_COE_UNION
 结构说明  : PC_NOISE_ALPHA_COE 寄存器结构定义。地址偏移量:0x594，初值:0x00000000，宽度:32
 寄存器说明: 
*****************************************************************************/
typedef union
{
    unsigned long      pc_noise_alpha_coe_reg;
    struct
    {
        unsigned long  cpu_noise_alpha_coe : 2;  /* bit[0-1]  : 功控噪声功率alpha滤波器系数。
                                                                2'b00，alpha滤波器系数为1/16；
                                                                2'b01，alpha滤波器系数为1/8；
                                                                2'b10，alpha滤波器系数为1/4；
                                                                2'b11，alpha滤波器系数为1/2。 */
        unsigned long  reserved_0          : 6;  /* bit[2-7]  : 保留 */
        unsigned long  cpu_h_rs_coe        : 1;  /* bit[8]    : 功控用于加权噪声的h模方右移系数。
                                                                1'b0，h模方右移4bit加权后噪声右移4bit；
                                                                1'b1，h模方右移3bit加权后噪声右移5bit。 */
        unsigned long  reserved_1          : 7;  /* bit[9-15] : 保留 */
        unsigned long  cpu_pc_preci_mode   : 2;  /* bit[16-17]: SIR target计算精度模式。
                                                                2'b00，在sir target配置的16bit无符号数中，整数部分占9位，小数部分占7位，精度为1/128；
                                                                2'b01，在sir target配置的16bit无符号数中，整数部分占8位，小数部分占8位，精度为1/256；
                                                                2'b10，在sir target配置的16bit无符号数中，整数部分占10位，小数部分占6位，精度为1/64。 */
        unsigned long  reserved_2          : 6;  /* bit[18-23]: 保留 */
        unsigned long  cpu_power_alpha_sel : 3;  /* bit[24-26]: 功控SIR计算中，信号能量滤波系数。
                                                                0，不滤波；
                                                                1，系数1/8；
                                                                2，系数2/8；
                                                                3，系数3/8；
                                                                4，系数4/8；
                                                                5，系数5/8；
                                                                6，系数6/8；
                                                                7，系数7/8。 */
        unsigned long  reserved_3          : 5;  /* bit[27-31]: 保留 */
    } reg;
} WBBP_PC_NOISE_ALPHA_COE_UNION;
#define WBBP_PC_NOISE_ALPHA_COE_cpu_noise_alpha_coe_START  (0)
#define WBBP_PC_NOISE_ALPHA_COE_cpu_noise_alpha_coe_END    (1)
#define WBBP_PC_NOISE_ALPHA_COE_cpu_h_rs_coe_START         (8)
#define WBBP_PC_NOISE_ALPHA_COE_cpu_h_rs_coe_END           (8)
#define WBBP_PC_NOISE_ALPHA_COE_cpu_pc_preci_mode_START    (16)
#define WBBP_PC_NOISE_ALPHA_COE_cpu_pc_preci_mode_END      (17)
#define WBBP_PC_NOISE_ALPHA_COE_cpu_power_alpha_sel_START  (24)
