typedef union
{
    unsigned long      tpc_hold_threshold_reg;
    struct
    {
        unsigned long  cpu_tpc_hold_threshold : 16; /* bit[0-15] : dl_tpc保持配置门限。在内环功控估计出的SIR值小于该门限时，上行发射功率根据DSP配置的功率调整值在原有功率基础上进行调整，此时dl_tpc字为2'b00。该值与sir_target的配置方式相同，不求对数，即为线性值，16位无符号数，默认整数部分占9位，小数部分占7位，精度为1/128。将计算结果直接乘以128，对结果四舍五入后直接配置给BBP即可。具体配置需要根据sir_target计算精度模式选择寄存器选择得到。当该值配置为16'd0时该功能关闭。 */
        unsigned long  reserved               : 16; /* bit[16-31]: 保留 */
    } reg;
} WBBP_TPC_HOLD_THRESHOLD_UNION;
