/*****************************************************************************
 结构名    : WBBP_PCH_EN_UNION
 结构说明  : PCH_EN 寄存器结构定义。地址偏移量:0x1E8，初值:0x00000000，宽度:32
 寄存器说明: 
*****************************************************************************/
typedef union
{
    unsigned long      pch_en_reg;
    struct
    {
        unsigned long  cpu_pch_en              : 1;  /* bit[0]    : Cell_PCH使能，高电平有效。 */
        unsigned long  cpu_p_scch_less         : 1;  /* bit[1]    : Cell_PCH状态下SCCH less active指示，高电平有效。cpu_pch_en有效时，解调采用本指示信号作为SCCH less active。 */
        unsigned long  cpu_rx_corr_mode        : 1;  /* bit[2]    : 天线相关性检测模式指示，高电平有效。在天线相关性检测模式下，辅载波固定取主载波数据进行信道估计和均衡。 */
        unsigned long  cpu_nco_en              : 1;  /* bit[3]    : NCO使能，高电平有效。 */
        unsigned long  cpu_smth_mode           : 1;  /* bit[4]    : 衰落平滑模式指示。0，后向2/4tap可变；1，后向固定2tap。 */
        unsigned long  reserved_0              : 3;  /* bit[5-7]  : 保留 */
        unsigned long  cpu_subfrm_mode         : 1;  /* bit[8]    : 均衡子帧模式指示。0，以HS-PDSCH子帧为基准；1，以HS-SCCH子帧为基准。 */
        unsigned long  reserved_1              : 3;  /* bit[9-11] : 保留 */
        unsigned long  cpu_sc_mode             : 1;  /* bit[12]   : 单载波模式指示，高电平有效。 */
        unsigned long  cpu_llr_shift_mode      : 1;  /* bit[13]   : LLR右移模式。0，64QAM下码道数小于3时右移2bit；1，不右移。 */
        unsigned long  cpu_noi_rx_mode         : 1;  /* bit[14]   : 噪声计算单双收噪声因子选择模式。0，单双收噪声因子门限和档位均采用多档方式；1，双收噪声因子门限和档位采用多档方式，单收采用固定因子方式，即V3R2和以前版本的方式。 */
        unsigned long  reserved_2              : 9;  /* bit[15-23]: 保留 */
        unsigned long  cpu_lmmse_ckg_bypass_sc : 8;  /* bit[24-31]: 均衡解扰解扩各子模块时钟自动门控功能旁路使能，高电平有效。0表示时钟自动门控功能打开；1表示时钟自动门控功能关闭，时钟常开。 */
    } reg;
} WBBP_PCH_EN_UNION;
#define WBBP_PCH_EN_cpu_pch_en_START               (0)
#define WBBP_PCH_EN_cpu_pch_en_END                 (0)
#define WBBP_PCH_EN_cpu_p_scch_less_START          (1)
#define WBBP_PCH_EN_cpu_p_scch_less_END            (1)
#define WBBP_PCH_EN_cpu_rx_corr_mode_START         (2)
#define WBBP_PCH_EN_cpu_rx_corr_mode_END           (2)
#define WBBP_PCH_EN_cpu_nco_en_START               (3)
#define WBBP_PCH_EN_cpu_nco_en_END                 (3)
#define WBBP_PCH_EN_cpu_smth_mode_START            (4)
#define WBBP_PCH_EN_cpu_smth_mode_END              (4)
#define WBBP_PCH_EN_cpu_subfrm_mode_START          (8)
#define WBBP_PCH_EN_cpu_subfrm_mode_END            (8)
#define WBBP_PCH_EN_cpu_sc_mode_START              (12)
#define WBBP_PCH_EN_cpu_sc_mode_END                (12)
#define WBBP_PCH_EN_cpu_llr_shift_mode_START       (13)
#define WBBP_PCH_EN_cpu_llr_shift_mode_END         (13)
#define WBBP_PCH_EN_cpu_noi_rx_mode_START          (14)
#define WBBP_PCH_EN_cpu_noi_rx_mode_END            (14)
#define WBBP_PCH_EN_cpu_lmmse_ckg_bypass_sc_START  (24)
#define WBBP_PCH_EN_cpu_lmmse_ckg_bypass_sc_END    (31)


