/*****************************************************************************
 结构名    : WBBP_MODE_SEL_UNION
 结构说明  : MODE_SEL 寄存器结构定义。地址偏移量:0x1F8，初值:0x00000000，宽度:32
 寄存器说明: 
*****************************************************************************/
typedef union
{
    unsigned long      mode_sel_reg;
    struct
    {
        unsigned long  cpu_newfg_smth_sel     : 2;  /* bit[0-1]  : 新径建立（包括径粗调更新）后稳定期内衰落平滑长度特殊处理指示。0，按照SMTH_LEN处理；1，固定按照5tap处理；2，不平滑；3，无意义。 */
        unsigned long  reserved_0             : 2;  /* bit[2-3]  : 保留 */
        unsigned long  cpu_gap_smth_sel       : 2;  /* bit[4-5]  : 出压缩沟后稳定期内衰落平滑长度特殊处理指示。0，按照SMTH_LEN处理；1，固定按照5tap处理；2，不平滑；3，无意义。 */
        unsigned long  reserved_1             : 2;  /* bit[6-7]  : 保留 */
        unsigned long  cpu_cqi_mode_sel       : 1;  /* bit[8]    : 均衡解调输出给上行调制的CQI有效指示生成方式选择。0，V1/V2/V3R1原有方式，即在压缩沟时指示无效；1，一直有效。 */
        unsigned long  cpu_w2_alg_sel         : 1;  /* bit[9]    : 从RAKE解调输入的CLD模式下W2值处理算法选择。0，按照以往版本方案处理；1，根据软件配置的CPICH和DPCH时隙偏差进行选择。 */
        unsigned long  cpu_outgap_sel         : 1;  /* bit[10]   : Ec/Ior和噪声估计的alpha滤波值出压缩沟后继续保持一个子帧的使能，高电平有效。 */
        unsigned long  reserved_2             : 1;  /* bit[11]   : 保留 */
        unsigned long  cpu_w2_slot_offset     : 4;  /* bit[12-15]: CLD模式下软件配置的CPICH和DPCH时隙偏差，在cpu_w2_alg_sel为1时，BBP根据此配置值选择DPCH所需时隙的W2值。 */
        unsigned long  reserved_3             : 8;  /* bit[16-23]: 保留 */
        unsigned long  cpu_pri_iorec_mode_sel : 2;  /* bit[24-25]: 主小区Ior/Ec计算模式选择。0，使用BBP内部计算值；1，使用DSP配置值。 */
        unsigned long  reserved_4             : 6;  /* bit[26-31]: 保留 */
    } reg;
} WBBP_MODE_SEL_UNION;
#define WBBP_MODE_SEL_cpu_newfg_smth_sel_START      (0)
#define WBBP_MODE_SEL_cpu_newfg_smth_sel_END        (1)
#define WBBP_MODE_SEL_cpu_gap_smth_sel_START        (4)
#define WBBP_MODE_SEL_cpu_gap_smth_sel_END          (5)
#define WBBP_MODE_SEL_cpu_cqi_mode_sel_START        (8)
#define WBBP_MODE_SEL_cpu_cqi_mode_sel_END          (8)
#define WBBP_MODE_SEL_cpu_w2_alg_sel_START          (9)
#define WBBP_MODE_SEL_cpu_w2_alg_sel_END            (9)
#define WBBP_MODE_SEL_cpu_outgap_sel_START          (10)
#define WBBP_MODE_SEL_cpu_outgap_sel_END            (10)
#define WBBP_MODE_SEL_cpu_w2_slot_offset_START      (12)
#define WBBP_MODE_SEL_cpu_w2_slot_offset_END        (15)
#define WBBP_MODE_SEL_cpu_pri_iorec_mode_sel_START  (24)
#define WBBP_MODE_SEL_cpu_pri_iorec_mode_sel_END    (25)


