/*****************************************************************************
 结构名    : WBBP_DLDEC_TEST_RPT_SCELL_RAM_00_UNION
 结构说明  : DLDEC_TEST_RPT_SCELL_RAM_00 寄存器结构定义。地址偏移量:0x29700，初值:0x00000000，宽度:32
 寄存器说明: 译码辅载波可维可测上报RAM子帧00字
*****************************************************************************/
typedef union
{
    unsigned long      dldec_test_rpt_scell_ram_00_reg;
    struct
    {
        unsigned long  reserved_0             : 1;  /* bit[0]    : 保留 */
        unsigned long  scch_tti_no_mc2        : 3;  /* bit[1-3]  : 当前子帧所属的子帧号，范围为0~4 */
        unsigned long  scch_type_mc2          : 4;  /* bit[4-7]  : HS-PDSCH调度的类型
                                                                   4’b0000：CELL_DCH非less帧或者F态非less帧
                                                                   4’b0001：CELL_DCH less初传帧
                                                                   4’b0010：CELL_DCH less一次重传帧
                                                                   4’b0011：CELL_DCH less二次重传帧
                                                                   4’b0100：P态非less帧
                                                                   4’b0101：scch_order帧
                                                                   4’b0110：MIMO模式单数据块
                                                                   4’b0111：MIMO模式双数据块
                                                                   4’b1000：P态less初传帧
                                                                   4’b1001：P态less一次重传帧
                                                                   4’b1010：P态less二次重传帧
                                                                   4’b1011：P态less三次重传帧
                                                                   4’b1100：P态less四次重传帧
                                                                   4’b1101：bcch逻辑信道帧
                                                                   4’b1111：非调度帧
                                                                   其他：保留
                                                                   【注】当为less帧时，hsd_detect_flag和hsd_crc_flag都为0，但hsd_ack_flag可能为1 */
        unsigned long  sfn_mc2                : 3;  /* bit[8-10] : 当前子帧所属的SFN号的低3bit，范围为0~7 */
        unsigned long  frm_invalid_ind_scell  : 1;  /* bit[11]   : 无效HS-PDSCH子帧指示，为1表示HS-PDSCH子帧对应的HS-SCCH与下行压缩GAP重合或部分重合，或者，HS-PDSCH子帧本身与下行压缩GAP重合或部分重合。 */
        unsigned long  hsd_detect_flag_scell  : 1;  /* bit[12]   : 本子帧HS-SCCH检测结果，为1表示检测成功，每个载波仅一个。
                                                                   【注】当子帧为非less帧时，hsd_detect_flag为0，则同一子帧上报信息域中除scch_type外均无效。 */
        unsigned long  reserved_1             : 3;  /* bit[13-15]: 保留 */
        unsigned long  hsd_crc_flag_scell     : 1;  /* bit[16]   : 本子帧HS-SCCH译码输出的校验结果，为1表示译码正确，每个载波仅一个。
                                                                   【注】当子帧为非less帧时，hsd_crc_flag为0，则同一子帧上报信息域中除scch_type、hsd_detect_flag外均无效。 */
        unsigned long  reserved_2             : 3;  /* bit[17-19]: 保留 */
        unsigned long  hsd_dc_crcflag_scell   : 1;  /* bit[20]   : 第一次译码CRC结果，指示均衡是否计算第二次CQI。
                                                                   1：正确，不需要启动；0：不正确，需要启动。
                                                                   目前该bit固定为0 */
        unsigned long  hsd_trs_no_ss          : 3;  /* bit[21-23]: 本子帧HS-PDSCH辅流进程所属传输次数
                                                                   0：表示初传
                                                                   1~7：表示第1～7次重传
                                                                   【注】在hsd_ack_flag=1有效时，表示是第几次传输时成功 */
        unsigned long  hsd_ack_ss_flag        : 1;  /* bit[24]   : 本载波本TTI辅流译码正确标志
                                                                   1'b0：未正确
                                                                   1'b1：正确 */
        unsigned long  hsd_ack_sp_flag        : 1;  /* bit[25]   : 本载波本TTI主流译码正确标志
                                                                   1'b0：未正确
                                                                   1'b1：正确 */
        unsigned long  reserved_3             : 1;  /* bit[26]   : 保留 */
        unsigned long  hsd_ack_sp_en          : 1;  /* bit[27]   : 本载波本TTI译码结束标志
                                                                   1'b0：未结束
                                                                   1'b1：结束 */
        unsigned long  hsd_dc_eeicflag_scell  : 1;  /* bit[28]   : 译码根据EEIC规格判断指示第二、三次均衡是否启动。
                                                                   0：非EEIC，不需要启动第二、三次均衡；
                                                                   1：EEIC，需要启动第二、三次均衡。
                                                                   目前该bit固定为0 */
        unsigned long  reserved_4             : 2;  /* bit[29-30]: 保留 */
        unsigned long  hsd_dec_overtime_scell : 1;  /* bit[31]   : 本载波本TTI译码超时
                                                                   1'b0：未超时
                                                                   1'b1：超时 */
    } reg;
} WBBP_DLDEC_TEST_RPT_SCELL_RAM_00_UNION;
#define WBBP_DLDEC_TEST_RPT_SCELL_RAM_00_scch_tti_no_mc2_START         (1)
#define WBBP_DLDEC_TEST_RPT_SCELL_RAM_00_scch_tti_no_mc2_END           (3)
#define WBBP_DLDEC_TEST_RPT_SCELL_RAM_00_scch_type_mc2_START           (4)
#define WBBP_DLDEC_TEST_RPT_SCELL_RAM_00_scch_type_mc2_END             (7)
#define WBBP_DLDEC_TEST_RPT_SCELL_RAM_00_sfn_mc2_START                 (8)
