#define WBBP_RACH_RESULT_RPT_rach_result_no_fail_END    (2)
#define WBBP_RACH_RESULT_RPT_rach_result_po_fail_START  (3)
#define WBBP_RACH_RESULT_RPT_rach_result_po_fail_END    (3)


