/*****************************************************************************
 结构名    : WBBP_DPCCH_BURST_UNION
 结构说明  : DPCCH_BURST 寄存器结构定义。地址偏移量:0x0A14，初值:0x00000000，宽度:32
 寄存器说明: 
*****************************************************************************/
typedef union
{
    unsigned long      dpcch_burst_reg;
    struct
    {
        unsigned long  dpcch_burst1_mod : 5;  /* bit[0-4]  : dtx_drx_enable激活帧CFN n中第一个子帧S=0处的((5*CFN - UE_DTX_DRX_Offset + S) MOD UE_DTX_cycle_1)计算结果。 */
        unsigned long  reserved_0       : 11; /* bit[5-15] : 保留 */
        unsigned long  dpcch_burst2_mod : 8;  /* bit[16-23]: dtx_drx_enable激活帧CFN n中第一个子帧S=0处的((5*CFN - UE_DTX_DRX_Offset + S) MOD UE_DTX_cycle_2)计算结果。 */
        unsigned long  reserved_1       : 8;  /* bit[24-31]: 保留 */
    } reg;
} WBBP_DPCCH_BURST_UNION;
#define WBBP_DPCCH_BURST_dpcch_burst1_mod_START  (0)
#define WBBP_DPCCH_BURST_dpcch_burst1_mod_END    (4)
#define WBBP_DPCCH_BURST_dpcch_burst2_mod_START  (16)
#define WBBP_DPCCH_BURST_dpcch_burst2_mod_END    (23)


/*****************************************************************************
 结构名    : WBBP_CQI_MOD_UNION
 结构说明  : CQI_MOD 寄存器结构定义。地址偏移量:0x0A18，初值:0x00000000，宽度:32
 寄存器说明: 
*****************************************************************************/
typedef union
{
    unsigned long      cqi_mod_reg;
    struct
    {
        unsigned long  cqi_mod_k : 7;  /* bit[0-6] : DTX_DRX_STATUS为TRUE时((5*CFN_DRX - UE_DTX_DRX_Offset + S_DRX ) MOD k)计算结果；
                                                     DTX_DRX_STATUS为FALSE时((5*CFN + ceiling(m*256chip/7680)) MOD k)计算结果。 */
        unsigned long  reserved  : 25; /* bit[7-31]: 保留 */
    } reg;
} WBBP_CQI_MOD_UNION;
#define WBBP_CQI_MOD_cqi_mod_k_START  (0)
#define WBBP_CQI_MOD_cqi_mod_k_END    (6)


/*****************************************************************************
 结构名    : WBBP_EDCH_PRE_CFG_UNION
 结构说明  : EDCH_PRE_CFG 寄存器结构定义。地址偏移量:0x0A1C，初值:0x00000000，宽度:32
 寄存器说明: 
*****************************************************************************/
typedef union
{
    unsigned long      edch_pre_cfg_reg;
    struct
    {
        unsigned long  edch_ready_cfg : 1;  /* bit[0]    : EDCH数据准备发送标志，BBP自清零。结合dtx_long_preamble_len的值以及当前DTX状态进行配置。
                                                           dtx_long_preamble_len=2时：在配置EDCH编码时刻配置。即10msTTI时在6ms中断配置；2msTTI时在上行2ms中断配置。
                                                           dtx_long_preamble_len=4时：10msTTI时，如果将在CFN=n帧发送EDCH数据，则在CFN=n-2的7.3ms中断处配置该信号；2msTTI时，提前一个2ms中断配置，即如果在s子帧需发送EDCH数据，则在s-2子帧的2ms中断处配置。
                                                           dtx_long_preamble_len=15时：10msTTI时，如果将在CFN=n帧发送EDCH数据，则在CFN=n-2的7.3ms中断处配置该信号；2msTTI时，如果数据将在CFN=n帧的第s个TTI子帧发射，则在CFN=n-1的第s-1个子帧的2ms中断处配置该信号。
                                                           如果当前DTX状态为UE_DTX_Cycle1，则统一按dtx_long_preamble_len=2进行配置。 */
        unsigned long  reserved_0     : 7;  /* bit[1-7]  : 保留 */
        unsigned long  edch_tx_cfn    : 8;  /* bit[8-15] : EDCH准备发送的帧（子帧）所在CFN帧号。 */
        unsigned long  edch_tx_s      : 3;  /* bit[16-18]: EDCH准备发送的子帧号，10msTTI时固定配0。 */
        unsigned long  reserved_1     : 13; /* bit[19-31]: 保留 */
    } reg;
} WBBP_EDCH_PRE_CFG_UNION;
#define WBBP_EDCH_PRE_CFG_edch_ready_cfg_START  (0)
#define WBBP_EDCH_PRE_CFG_edch_ready_cfg_END    (0)
#define WBBP_EDCH_PRE_CFG_edch_tx_cfn_START     (8)
#define WBBP_EDCH_PRE_CFG_edch_tx_cfn_END       (15)
#define WBBP_EDCH_PRE_CFG_edch_tx_s_START       (16)
#define WBBP_EDCH_PRE_CFG_edch_tx_s_END         (18)


